import React from 'react';
import './Scouting.css';
import Position from '../../img/Position/Bottom.png';
import imageRank from '../../img/Rank/Season_2019_-_Gold_3.png';


class Scouting extends React.Component {

    


    constructor (props){
        super(props);
        this.state = {
            summonerName: 'Martinounux',
            imgMainPosition: Position,
            Rank: {
                imgRank: imageRank,
                rankName: 'Gold III',
                LP: 'O',
                Win: '53',
                lose: '45',
            }
        };
        
    }


    render() {
        return(
            <div id="Scouting">
                <h1>SCOUTING</h1>
                <div id="border">
                    <div id="SummonerName">
                        {this.state.summonerName}
                    </div>
                    <div id="positionRank">
                        <img src={this.state.imgMainPosition}/>
                        <div>

                        </div>
                    </div>
                    <div id="mostValuableRank">

                    </div>
                </div>
            </div>
        );
    }
}

export default Scouting;
